import java.util.*;
import java.io.*;

class  Main {
    public static void main(String[] args) throws Exception {
        Scanner sc = new Scanner(System.in);
        HashMap<Long, Integer> m = new HashMap<>();
        int n = sc.nextInt();
        long[] val = new long[n];
        long[] colors = new long[n];
        for (int i = 0; i < n; i++) {
            val[i] = sc.nextInt();
        }
        for (int i = 0; i < n; i++) {
            colors[i] = sc.nextInt();
        }
        m.put(colors[0], 0);
        colors[0] = 0;
        for (int i = 1; i < n; i++) {
            long input = colors[i];
            if (m.getOrDefault(input, -1) == -1) {
                m.put(input, i);
                long a = colors[i - 1] + 1;
                colors[i] = a;
                long b = val[i - 1] + val[i];
                val[i] = b;
            } else {

                int k = m.get(input);

                long a = 0;
                long c = 0;
                a = val[i] + val[k];
                c = val[i] + val[i - 1];
                if (colors[k] == colors[i - 1]) {
                    long b = colors[k] + 1;
                    colors[i] = b;
                    if (a > c) {
                        val[i] = a;
                    } else {
                        val[i] = c;
                    }
                } else if (colors[k] > colors[i - 1]) {
                    colors[i] = colors[i - 1] + 1;
                    val[i] = c;
                } else {
                    colors[i] = colors[k] + 1;
                    val[i] = a;
                }

                m.put(input, i);
            }

        }

        System.out.println(colors[n - 1] + " " + val[n - 1]);
    }

    static StringBuilder sb = new StringBuilder();
}
